import React from 'react'
import {list}from './Form'
import { useContext } from 'react'
function List() {
    let x=useContext(list)
  return (
    

            <div style={{color:"blue"}}>
                {x.map((item,i)=>{      
                return <ul key={i}>               
                <li>{item.username}</li> 
                <li>{item.email}</li> 
                <li>{item.password}</li>             
                </ul>})}
            </div>
    
  )
}

export default List
